import Navbar from "./components/NavBar";
import ChatPage from "./pages/ChatPage";

function App() {
  return (
    <div className="min-h-screen flex flex-col bg-primary-background text-white bg-blurry-shapes bg-cover bg-center bg-no-repeat overflow-y-auto">
      <div className="pr-4 pl-4 flex-shrink-0">
        <Navbar />
      </div>
      <div className="flex-grow">
        <ChatPage />
      </div>
    </div>
  );
}

export default App;
